import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import StudentDashboard from './pages/student/Dashboard';
import StudentCourses from './pages/student/Courses';
import StudentAssessments from './pages/student/Assessments';
import CourseDetails from './pages/CourseDetails';
import AssessmentDetails from './pages/AssessmentDetails';
import Profile from './pages/Profile';
import AdminDashboard from './pages/admin/Dashboard';
import UploadCourse from './pages/admin/UploadCourse';
import UploadAssessment from './pages/admin/UploadAssessment';
import Users from './pages/admin/Users';
import Analytics from './pages/admin/Analytics';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Toaster position="top-right" />
        <div className="min-h-screen bg-gray-100">
          <Navbar />
          <main className="container mx-auto px-4 py-8">
            <Routes>
              {/* Public Routes */}
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* Student Routes */}
              <Route path="/student/dashboard" element={
                <ProtectedRoute allowedRoles={['student']}>
                  <StudentDashboard />
                </ProtectedRoute>
              } />
              <Route path="/student/courses" element={
                <ProtectedRoute allowedRoles={['student']}>
                  <StudentCourses />
                </ProtectedRoute>
              } />
              <Route path="/student/assessments" element={
                <ProtectedRoute allowedRoles={['student']}>
                  <StudentAssessments />
                </ProtectedRoute>
              } />
              <Route path="/courses/:id" element={
                <ProtectedRoute allowedRoles={['student']}>
                  <CourseDetails />
                </ProtectedRoute>
              } />
              <Route path="/assessments/:id" element={
                <ProtectedRoute allowedRoles={['student']}>
                  <AssessmentDetails />
                </ProtectedRoute>
              } />
              <Route path="/profile" element={
                <ProtectedRoute allowedRoles={['student', 'admin']}>
                  <Profile />
                </ProtectedRoute>
              } />

              {/* Admin Routes */}
              <Route path="/admin" element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <AdminDashboard />
                </ProtectedRoute>
              } />
              <Route path="/admin/upload-course" element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <UploadCourse />
                </ProtectedRoute>
              } />
              <Route path="/admin/upload-assessment" element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <UploadAssessment />
                </ProtectedRoute>
              } />
              <Route path="/admin/users" element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <Users />
                </ProtectedRoute>
              } />
              <Route path="/admin/analytics" element={
                <ProtectedRoute allowedRoles={['admin']}>
                  <Analytics />
                </ProtectedRoute>
              } />

              {/* Redirect to home if no route matches */}
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </main>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
